function Social () {
    return (
        <ul className="list-group">
            
            <li className="list-group-item ">
                <input id = "Facebook" type="checkbox"/>
                <label for ="facebook" className="form-control">Facebook</label>

            
            </li>
        <li className ="list-group-item ">facebook</li>
            <li className="list-group-item">youtub</li>
            
      </ul>
    )
}


export default Social
